        <div className="flex items-center justify-center h-screen">
            <div className="bg-white shadow-lg rounded-lg p-6 pl-lg:10">
                <LoginHeader
                    heading="Login to your account"
                    paragraph="Don't have an account yet? "
                    linkName="Register"
                    linkUrl="/Register"
